import styled from "styled-components";
import { ReactNode } from "react";

type PrimaryButtonProps = {
  children: ReactNode;
  type?: "button" | "submit";
  handleClick?: () => void;
};
function PrimaryButton({ children, type, handleClick }: PrimaryButtonProps) {
  return (
    <MyButton type={type} onClick={type === "button" ? handleClick : undefined}>
      {children}
    </MyButton>
  );
}

const MyButton = styled.button`
  height: 40px;
  width: 180px;
  background-color: inherit;
  border: 1.5px solid black;
  border-radius: 30px;
  font-size: 0.9rem;
  transition: 1s ease-in-out;

  &:hover {
    background-color: blue;
  }
`;

export default PrimaryButton;
